public static int nullSafeHashCode(long[] array){
	if (array == null) {
		return 0;
	}
	int hashCode = INITIAL_HASH;
	for (int i = 0; i < array.length; i++) {
		hashCode = MULTIPLIER * hashCode + nullSafeHashCode(array[i]);
	}
	return hashCode;
}

private TreeNode<T> rotateRight(TreeNode<T> node){
	if(node==null)
		return null;
	TreeNode<T> left=node.getLeft();
	if(left==null)
		return node;
	if(left.isLeftChild())
		node.setLeft(left.getRight());
	else if(left.isRightChild())
		node.setLeft(left.getRight().getLeft());
	if(left.getRight()!=null)
		left.getRight().setLeft(node);
	if(left.getLeft()!=null)
		left.getLeft().setRight(node);
	if(node.isLeftChild())
		left.setRight(node);
	else if(node.isRightChild())
		left.setLeft(node);
	if(node.getParent()==null)
		return left;
	if(node.isLeftChild())
		node.getParent().setLeft(left);
	else if(node.isRightChild())
		node.getParent().setRight(left);
	left.setParent(node.getParent());
	node.setParent(left);
	left.updateHeightAndSubtreeSize();
	node.updateHeightAndSubtreeSize();
	return left;
}

