private int parseEndOfLine(String headerPart,int end){
	if(end < 0){
		return -1;
	}
	if(end >= headerPart.length()){
		return -1;
	}
	if(headerPart.charAt(end) == '\r'){
		if(end + 1 >= headerPart.length()){
			return -1;
		}
		if(headerPart.charAt(end + 1) == '\n'){
			return end + 2;
		}
	}else if(headerPart.charAt(end) == '\n'){
		return end + 1;
	}
	return -1;
}

