static long compressTimeBucket(long timeBucket,int dayStep){
if(dayStep == 1){
return timeBucket;
}
long day = timeBucket / Const.ONE_DAY_MILLIS;
long remainder = timeBucket % Const.ONE_DAY_MILLIS;
if(remainder == 0){
return day * Const.ONE_DAY_MILLIS;
}
if(remainder < (Const.ONE_DAY_MILLIS / dayStep)){
return day * Const.ONE_DAY_MILLIS;
}
if(remainder >= (Const.ONE_DAY_MILLIS / dayStep)){
return (day + 1) * Const.ONE_DAY_MILLIS;
}
return timeBucket;
}

public static int computeUTF8Size(final CharSequence str,final int index,final int len){
