public long readRawVarint64() throws IOException {
	int shift = 0;
	long result = 0;
	while (true) {
		if (bufferPos >= bufferSize) {
			if (bufferPos >= bufferSizeAfterLimit) {
				throw new IOException("CodedInputStream reached limit");
			}
			if (input == null) {
				throw new IOException("CodedInputStream reached limit");
			}
			if (bufferPos == bufferSize) {
				if (bufferSize == DEFAULT_BUFFER_SIZE) {
					buffer = new byte[DEFAULT_BUFFER_SIZE];
				} else {
					byte[] newBuffer = new byte[bufferSize * 2];
					System.arraycopy(buffer, 0, newBuffer, 0, bufferSize);
					buffer = newBuffer;
				}
			}
			if (bufferSizeAfterLimit > 0) {
				if (bufferSizeAfterLimit == bufferSize) {
					if (bufferSize == DEFAULT_BUFFER_SIZE) {
						buffer = new byte[DEFAULT_BUFFER_SIZE];
					} else {
						byte[] newBuffer = new byte[bufferSize * 2];
						System.arraycopy(buffer, 0, newBuffer, 0, bufferSize);
						buffer = newBuffer;
					}
				} else {
					System.arraycopy(buffer, bufferSizeAfterLimit, buffer, 0, bufferSize - bufferSizeAfterLimit);
				}
			}
			if (bufferSizeAfterLimit > 0) {
				bufferSize = bufferSizeAfterLimit;
			} else {
				bufferSize = DEFAULT_BUFFER_SIZE;
			}
			bufferSizeAfterLimit = 0;
			if (input.read(buffer, bufferSize, buffer.length - bufferSize) == -1) {
				if (bufferPos == 0) {
					throw new IOException("CodedInputStream read beyond limit");
				}
				if (bufferPos < 8) {
					throw new IOException("CodedInputStream read beyond limit");
				}
				bufferSize = bufferPos;
				bufferPos = 0;
				break;
			}
			bufferSize += buffer.length - bufferSize;
		}
		int b = buffer[bufferPos++];
		result |= (long) (b & 0x7F) << shift;
		if ((b & 0x80) == 0) {
			break;
		}
		shift += 7;
	}
