public static Pair<Box2D,Box2D> splitAlongXAxis(Box2D box){
	if(box.getWidth()<=0){
		throw new IllegalArgumentException("The width of the box must be positive");
	}
	if(box.getHeight()<=0){
		throw new IllegalArgumentException("The height of the box must be positive");
	}
	if(box.getWidth()<box.getHeight()){
		throw new IllegalArgumentException("The width of the box must be greater than the height");
	}
	double halfWidth=box.getWidth()/2;
	Box2D left=new Box2D(box.getX(),box.getY(),halfWidth,box.getHeight());
	Box2D right=new Box2D(box.getX()+halfWidth,box.getY(),halfWidth,box.getHeight());
	return new Pair<Box2D,Box2D>(left,right);
}

