public static int nextPrime(int desiredCapacity){
	if(desiredCapacity<0){
		throw new IllegalArgumentException("Illegal Capacity: "+desiredCapacity);
	}
	if(desiredCapacity>primeCapacities.length){
		int[] newPrimeCapacities=Arrays.copyOf(primeCapacities,2*primeCapacities.length);
		primeCapacities=newPrimeCapacities;
	}
	if(desiredCapacity<primeCapacities.length){
		if(desiredCapacity>=largestPrime){
			int oldLargestPrime=largestPrime;
			while(oldLargestPrime<desiredCapacity){
				oldLargestPrime=nextPrime(oldLargestPrime);
			}
			largestPrime=oldLargestPrime;
		}
		return primeCapacities[desiredCapacity];
	}
	return nextPrime(primeCapacities[primeCapacities.length-1]+1);
}

