throw new IllegalArgumentException("Invalid constant pool entry index: " + constantPoolEntryIndex);
}
if(constantUtf8Values[constantPoolEntryIndex] == null){
final int utf8Offset=cpInfoOffsets[constantPoolEntryIndex];
if(utf8Offset == 0){
constantUtf8Values[constantPoolEntryIndex]="";
}
else if(utf8Offset < 0 || utf8Offset > classFileBuffer.length){
throw new IllegalArgumentException("Invalid utf8 offset: " + utf8Offset);
}
else {
final int utf8Length=readUnsignedShort(utf8Offset);
if(utf8Length < 0 || utf8Offset + utf8Length > classFileBuffer.length){
throw new IllegalArgumentException("Invalid utf8 length: " + utf8Length);
}
if(charBuffer == null){
constantUtf8Values[constantPoolEntryIndex]=new String(classFileBuffer,utf8Offset + 2,utf8Length,UTF8);
}
else {
readUtf(utf8Offset + 2,utf8Length,charBuffer);
}
}
}
return constantUtf8Values[constantPoolEntryIndex];
}

