public static boolean containsInstance(Collection collection,Object element){
	if(collection==null){
		return false;
	}
	if(element==null){
		return false;
	}
	if(collection.contains(element)){
		return true;
	}
	if(collection instanceof List){
		if(((List)collection).contains(element)){
			return true;
		}
	}
	if(collection instanceof Set){
		if(((Set)collection).contains(element)){
			return true;
		}
	}
	if(collection instanceof Map){
		if(((Map)collection).containsValue(element)){
			return true;
		}
	}
	if(collection instanceof Enumeration){
		if(((Enumeration)collection).hasMoreElements()){
			if(((Enumeration)collection).nextElement()==element){
				return true;
			}
		}
	}
	if(collection instanceof Iterator){
		if(((Iterator)collection).hasNext()){
			if(((Iterator)collection).next()==element){
				return true;
			}
		}
	}
	return false;
}

