private String parseToken(final char[] terminators){
	if(terminators == null){
		return null;
	}
	if(terminators.length == 0){
		return null;
	}
	if(terminators.length == 1){
		return parseToken(terminators[0]);
	}
	final int len = terminators.length;
	final int i1 = pos;
	while(pos < len){
		final char ch = chars[pos];
		if(isOneOf(ch,terminators)){
			break;
		}
		pos++;
	}
	if(pos == i1){
		return null;
	}
	final int i2 = pos;
	pos++;
	return new String(chars,i1,i2 - i1);
}

